import React from 'react';
import {BrowserRouter } from "react-router-dom";
import Teacher from './components/Teacher/Teacher'

import './App.css';

function App() {
  return (
    <BrowserRouter>
      <Route path="teacher" render={()=><Teacher/>}> </Route>
      <Route path="student" render={()=><Student/>}></Route>

      <Student/>
    </BrowserRouter>
  );
}

export default App;
